import React, {Component} from 'react';

class Index extends Component {
    render() {
        return (
            <div className={'fenleiNav'}>
                <div className={'nav_img'}>
                    <img src={require('../../common/images/xinpin.jpg')} alt=""/>
                    <img src={require('../../common/images/dazhong.jpg')} alt=""/>
                    <img src={require('../../common/images/xiaomicc.jpg')} alt=""/>
                    <img src={require('../../common/images/huanxin.jpg')} alt=""/>
                    <img src={require('../../common/images/zhuanqu.jpg')} alt=""/>
                    <img src={require('../../common/images/miaosha.png')} alt/>>
                    <img src={require('../../common/images/bijiben.png')} alt=""/>
                    <img src={require('../../common/images/remai.png')} alt=""/>
                    <img src={require('../../common/images/kongt.jpg')} alt=""/>
                    <img src={require('../../common/images/fenka.png')} alt=""/>

                </div>
                {/*<div className={'nav_img'}>*/}
                {/*   */}
                {/*</div>*/}
            </div>
        );
    }
}

export default Index;
